defined('CB_VALID_ENTRY') or die();

$db = KenedoPlatform::getDb();

$defaultLangTag = KenedoPlatform::p()->getLanguageTag();

$platformLanguages = KenedoPlatform::p()->getLanguages();

$currentIsAvailable = false;

foreach ($platformLanguages as $language) {

	$query = "INSERT INTO `#__configbox_active_languages` SET `tag` = '".$db->getEscaped($language->tag)."'";
	$db->setQuery($query);
	$db->query();

	if ($language->tag == $defaultLangTag) {
		$currentIsAvailable = true;
	}

}

if ($currentIsAvailable == false) {
	$defaultLangTag = $platformLanguages[key($platformLanguages)]->tag;
}

// Add the default customer group
